import React, { useState, useEffect } from "react";
import Icon from "react-native-vector-icons/AntDesign" 
import Icon1 from "react-native-vector-icons/Feather";
import { SafeAreaView, View, Text, ScrollView, StyleSheet, TouchableOpacity, TextInput } from "react-native";
import {  
    FirstView5,
    BigText4,
    SecondView4,
    PhotoView1,
    Quantity1,
    QtyText1,
    ButtonText1
} from "../componenets/fintech5Style"
import { ButtonTextt } from "../componenets/fintech4Style";


export default function Fintech5({navigation, route}){
    const [routee, setRoute]= useState(route.params.paramKey);
    return(
        <SafeAreaView style={styles.fintech5container}>
            <ScrollView>
                <FirstView5>
                <TouchableOpacity style={styles.back3} onPress={()=>navigation.navigate("Fintech2")}>
                   <Icon size={30} color="#C3AD60" name="back" style={styles.pad4}/> 
                    </TouchableOpacity>
                   <BigText4 style={styles.pad}>Procurement</BigText4>
                   <TouchableOpacity onPress={()=>navigation.navigate("Fintech10")}>
                        <Icon size={20} color= "#C3AD60" name='bells' style={styles.padddd}/>
                    </TouchableOpacity>
                    <TouchableOpacity style={styles.touch} onPress={()=>navigation.navigate("Fintech6")}>
                        <Icon1 size={20} color="#C3AD60" name="clipboard" style={styles.paddd}/>
                    </TouchableOpacity>
                </FirstView5>
                <SecondView4>
                <PhotoView1 source={require('../../../../assets/pro.png')}>
                    <Quantity1><QtyText1>Qty: 1</QtyText1><Icon name="caretdown" size={6} color="#fff"/></Quantity1>
                    <View style={styles.linkView}>
                    <Text 
                    style={styles.link}
                    >
                        {routee}
                    </Text>
                    </View>
                </PhotoView1>
                </SecondView4>
            </ScrollView>
            <View style={styles.center}>
            <TouchableOpacity style={styles.btn} onPress={()=>navigation.navigate("Fintech6")}>
                    <ButtonTextt>Add Item</ButtonTextt>
                </TouchableOpacity>
            <TouchableOpacity style={styles.btn6} onPress={()=>navigation.navigate("Fintech11", {paramKey: param.paramKey})}>
                    <ButtonText1>Submit</ButtonText1>
                </TouchableOpacity>
            </View>
        </SafeAreaView>


)}

const styles = StyleSheet.create({
    fintech5container: {
        backgroundColor: "#000",
        paddingTop: 25,
        flex: 1,
        position: "relative",
    },
    back3: {
        
    },
    pad4: {
        paddingLeft: 40,
    },
    pad: {
        paddingLeft: 55,
        paddingRight: 28,
    },
    padddd: {
        paddingRight: 28,
    },
    center: {
        alignItems: "center",
    },
    btn: {
        height: 48,
        width: 283,
        borderRadius: 100,
        backgroundColor: "#000",
        marginTop: 270,
        alignItems: "center",
        justifyContent: "center",
        position: "absolute",
        top: 243,
        borderWidth: 1,
        borderColor: "#C3AD60"
    },
    btn6: {
        height: 48,
        width: 283,
        borderRadius: 100,
        backgroundColor: "#C3AD60",
        marginTop: 270,
        alignItems: "center",
        justifyContent: "center",
        position: "absolute",
        top: 315,
        left: 44
    },
    linkView: {
        height: 54,
        width: 320,
        backgroundColor: "#4E4E4E",
        borderBottomLeftRadius: 13,
        borderBottomRightRadius: 13,
        paddingLeft: 25,
        justifyContent:"space-between",
        marginTop: 100,
        flexDirection: "row",
        alignItems: "center",
        paddingRight: 25,
    
     },
     link: {
        color: "#fff"
     }
});
